import { BrowserRouter } from "react-router-dom";
import { AuthProvider } from "./context/AuthContext";
import Navbar from "./components/Navbar";

function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <Navbar />
        {/* your Routes here */}
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
